stringArray1.splice(1, 1);

function AddingAndRemovingArrays() {
    return (
        <>
            <h2>Add and remove data from arrays</h2>
            numberArray1 = {NumberArray1} <br/>
            stringArray1 = {stringArray1} <br/>
        </>
    )
} export default AddingAndRemovingArrays;
